import React, { Component } from 'react'
import Item from '../Item'
import './index.css'

export default class List extends Component {
  render() {
    const todos = this.props.todos
    return (
      <ul className="todo-main">
        <Item/>
        {
          todos.map((todo)=>{
            console.log(todo)
            return <Item key={todo.id}/>
          })
        }
      </ul>
    )
  }
}
